description:
Mrs. Ryder was a tough boss. It seemed no coincidence that her last name was Ryder because Mia rode her employees hard. This afternoon, she found her lawn man, JB, napping on the job. Mia stormed over to wake him and began to berate him from his attitude to his lack of work ethic. JB pleaded to keep his job and begged Mrs. Ryder not to tell her husband. Mia had no intention of telling her husband, especially because she liked to ride her help. JB was worried, at first, but when a tough big tit boss wants something, you have to let her have it!
